import React, { useState } from 'react';

function Dropdown({ task, priorities, setPriorities, tags, setTags }) {
    const [showPriorityDropdown, setShowPriorityDropdown] = useState(false);

    const handleAddPriorityClick = () => {
        setShowPriorityDropdown(!showPriorityDropdown);
    };

    const handlePriorityChange = (event) => {
        const selectedPriority = event.target.value;
        setPriorities([selectedPriority]);
    };

    return (
        <>

            <div className="dropdown">
                {showPriorityDropdown && (
                    <div className="dropdown-tags">
                        <div className="dropdown-header">
                            <div className="dropdown-title">
                                <p>Priorities</p>
                            </div>
                            <div className="dropdown-close">
                                <span className="material-symbols-outlined">close</span>
                            </div>
                        </div>
                        <hr />
                        <ul>
                            {priorities.map((priority) => (
                                <li key={priority.priority_id}>
                                    <label>
                                        <input type="checkbox" value={priority.priority_id} checked={priority.priority_id === task.priority_id} onChange={handlePriorityChange} />
                                        <span className="priority" style={{ background: priority.priority_color }}>{priority.priority_name}</span>
                                    </label>
                                    <span className="material-symbols-outlined edit">edit</span>
                                </li>
                            ))}
                        </ul>
                    </div>
                )}
                <div className="add-tags">
                    <div className="tagDrop-btn">
                        <span className="material-symbols-outlined" onClick={handleAddPriorityClick}>add</span>
                    </div>
                </div>
            </div>

            <div className="dropdown">
                {showTagDropdown && (
                    <div className="dropdown-tags">
                        <div className="dropdown-close">
                            <span className="material-symbols-outlined" onClick={handleCloseEditDropdown}>close</span>
                        </div>
                        <hr>
                        </hr>
                        <ul>
                            {tags.map((tag, index) => (
                                <li key={index}>
                                    <label>
                                        <input type="checkbox" checked={selectedTags.includes(tag)} onChange={() =>
                                            handleTagSelection(tag)} />
                                        <span className="tag" style={{ background: tag.color }}>{tag.name}</span>
                                    </label>
                                    <span className="material-symbols-outlined edit">edit</span>
                                </li>
                            ))}
                        </ul>
                    </div>
                )}
                <div className="add-tags">
                    {selectedTags.length > 0 && (
                        <div className="selected-tags">
                            <div className="tags">
                                {selectedTags.map((tag, index) => (
                                    <div className="tag" key={index} style={{ background: tag.color }}>{tag.name}</div>
                                ))}
                            </div>
                        </div>
                    )}
                    <div className="tagDrop-btn">
                        <span className="material-symbols-outlined" onClick={handleAddTagClick}>add</span>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Dropdown;
